import React from "react"
import Testimonial from './Testimonial.js';

import './AboutUs.css'
import logo from './lendelogoblack.png';
import kenny from './kenny-chi.jpeg'

function AboutUs(props) {
    return (
        <center className = 'aboutus'>
            <img src={logo} className='logo-aboutus' alt={'lende logo'} />
            <Testimonial className = 'testimonial' align='left' name='Kenny' text='hello my name is kenny' image={kenny} size={{width: "1000px", height: "200px"}}/>
            <Testimonial className = 'testimonial' align='right' name='Kenny' text='hello my name is kenny' image={kenny} size={{width: "1000px", height: "200px"}}/>
        </center>
    )

}
export default AboutUs
